# ===== Logging Function =====
def log_action(action):
    try:
        user = getpass.getuser()
        timestamp = datetime.now().strftime("%Y-%m-%d %H:%M:%S")
        log_entry = f"[{timestamp}] {user} - Camera {action}\n"

        with open(log_file_path, "a") as log_file:
            log_file.write(log_entry)
    except Exception as e:
        print("Logging failed:", str(e))

# ===== Registry Function =====
def set_webcam_permission(state):
    try:
        key_path = r"Software\\Microsoft\\Windows\\CurrentVersion\\CapabilityAccessManager\\ConsentStore\\webcam"
        key = winreg.OpenKey(winreg.HKEY_CURRENT_USER, key_path, 0, winreg.KEY_SET_VALUE)
        winreg.SetValueEx(key, "Value", 0, winreg.REG_SZ, state)
        winreg.CloseKey(key)

        messagebox.showinfo("Success", f"Camera permission set to '{state}' successfully.")
        log_action(state)
    except PermissionError:
        messagebox.showerror("Permission Denied", "Run as Administrator to change registry.")
    except Exception as e:
        messagebox.showerror("Error", f"Failed to change camera permission:\n{str(e)}")

# ===== Password Prompt Wrapper =====
def ask_password_and_set_permission(state):
    entered_password = simpledialog.askstring("Password Required", "Enter Password:", show="*")
    if entered_password == current_password:
        set_webcam_permission(state)
    else:
        messagebox.showerror("Error", "Incorrect Password")

# ===== Change Password Handler =====
def change_password():
    global current_password
    old_pass = simpledialog.askstring("Change Password", "Enter Current Password:", show="*")
    if old_pass != current_password:
        messagebox.showerror("Error", "Incorrect current password")
        return

    new_pass = simpledialog.askstring("New Password", "Enter New Password:", show="*")
    confirm_pass = simpledialog.askstring("Confirm Password", "Re-enter New Password:", show="*")

    if new_pass and new_pass == confirm_pass:
        current_password = new_pass
        messagebox.showinfo("Success", "Password changed successfully")
    else:
        messagebox.showerror("Error", "Passwords do not match")

# === Open Log File ===
def open_log_file():
    log_path = os.path.abspath(log_file_path)
    if not os.path.exists(log_path):
        with open(log_path, "w") as f:
            f.write("Camera Logs\n")
    os.startfile(log_path)

