# === Navigation Button Handler ===
def nav_action(text):
    if text == "View Logs":
        open_log_file()
    elif text == "Check Status":
        try:
            key_path = r"Software\\Microsoft\\Windows\\CurrentVersion\\CapabilityAccessManager\\ConsentStore\\webcam"
            key = winreg.OpenKey(winreg.HKEY_CURRENT_USER, key_path, 0, winreg.KEY_READ)
            value, _ = winreg.QueryValueEx(key, "Value")
            winreg.CloseKey(key)
            messagebox.showinfo("Camera Status", f"Camera permission is currently: {value}")
        except FileNotFoundError:
            messagebox.showerror("Error", "Camera permission key not found.")
        except Exception as e:
            messagebox.showerror("Error", f"Failed to check status:\n{str(e)}")
    elif text == "Change Password":
        change_password()
    elif text == "Project Info":
        show_project_info()
    else:
        messagebox.showinfo(text, f"{text} clicked")

